2	Fullmetal Alchemist: Brotherhood	https://www.anime-planet.com/images/anime/covers/thumbs/fullmetal-alchemist-brotherhood-2360.jpg?t=1475346984	2	The foundation of alchemy is based on the law of equivalent exchange; you cannot produce something from nothing. As such, alchemy is bound by one taboo - human transmutation. Four years ago two young brothers, Edward and Alphonse Elric, broke this taboo when they tried to resurrect their dead mother. During the process Al's body disintegrated and Ed lost his leg. In a desperate attempt to prevent his brother from disappearing completely, Ed sacrificed one of his arms so he could affix Al's soul to a suit of armor. When his missing limbs are replaced by auto mail parts, Ed bears the name of the Fullmetal Alchemist - the youngest ever State Alchemist and dog of the military. Now, alongside his brother, Ed uses his status within the military to attempt to find any way that he can return their bodies back to their original state.	2009	2021-07-03 11:49:15.374+02	2021-07-03 11:49:15.374+02
3	Attack on Titan The Final Season	https://www.anime-planet.com/images/anime/covers/thumbs/attack-on-titan-the-final-season-13739.jpg?t=1613242566	3	It's been four years since the Scout Regiment reached the shoreline, and the world looks different now. Things are heating up as the fate of the Scout Regiment—and the people of Paradis—are determined at last. However, Eren is missing. Will he reappear before age-old tensions between Marleyans and Eldians result in the war of all wars?	2020	2021-07-03 11:49:15.398+02	2021-07-03 11:49:15.398+02
4	Attack on Titan 3rd Season: Part II	https://www.anime-planet.com/images/anime/covers/thumbs/attack-on-titan-3rd-season-part-ii-11965.jpg?t=1555618117	4	The battle to retake Wall Maria begins now! With Eren’s new hardening ability, the Scouts are confident they can seal the wall and take back Shiganshina District. If they succeed, Eren can finally unlock the secrets of the basement—and the world. But danger lies in wait as Reiner, Bertholdt, and the Beast Titan have plans of their own. Could this be humanity’s final battle for survival?	2019	2021-07-03 11:49:15.417+02	2021-07-03 11:49:15.417+02
5	Demon Slayer: Kimetsu no Yaiba Movie - Mugen Train	https://www.anime-planet.com/images/anime/covers/thumbs/demon-slayer-kimetsu-no-yaiba-movie-mugen-train-14059.jpg?t=1619536289	5	Tanjirou and the group have completed their rehabilitation training at the Butterfly Mansion, and they arrive to their next mission on the Mugen Train, where over 40 people have disappeared in a very short period of time. Tanjirou and Nezuko, along with Zenitsu and Inosuke, join one of the most powerful swordsmen within the Demon Slayer Corps, Flame Hashira Rengoku Kyoujurou, to face the demon aboard the Mugen Train on track to despair.	2020	2021-07-03 11:49:15.437+02	2021-07-03 11:49:15.437+02
6	Jujutsu Kaisen	https://www.anime-planet.com/images/anime/covers/thumbs/jujutsu-kaisen-14229.jpg?t=1600968159	6	Although Yuji Itadori looks like your average teenager, his immense physical strength is something to behold! Every sports club wants him to join, but Itadori would rather hang out with the school outcasts in the Occult Research Club. One day, the club manages to get their hands on a sealed cursed object. Little do they know the terror they’ll unleash when they break the seal…	2020	2021-07-03 11:49:15.464+02	2021-07-03 11:49:15.464+02
7	Haikyuu!! Karasuno High School vs Shiratorizawa Academy	https://www.anime-planet.com/images/anime/covers/thumbs/haikyuu-karasuno-high-school-vs-shiratorizawa-academy-7777.jpg?t=1534187552	7	Picking up where the second season ended, the boys prepare to finally face off for the right to represent the prefecture in the volleyball national championship. Despite being known as “The Fallen Champions,” Karasuno is determined to take down the powerhouse that is the Shiratorizawa High volleyball team. As Hinata comes closer to fulfilling his promise to defeat Ushijima’s team, will the “Flightless Crows” finally find their wings and soar above the best school in the prefecture? 	2016	2021-07-03 11:49:15.482+02	2021-07-03 11:49:15.482+02
8	A Silent Voice	https://www.anime-planet.com/images/anime/covers/thumbs/a-silent-voice-6805.jpg?t=1520541155	8	After transferring into a new school, a deaf girl, Shouko Nishimiya, is bullied by the popular Shouya Ishida. As Shouya continues to bully Shouko, the class turns its back on him. Shouko transfers and Shouya grows up as an outcast. Alone and depressed, the regretful Shouya finds Shouko to make amends. 	2016	2021-07-03 11:49:15.492+02	2021-07-03 11:49:15.492+02
9	Hunter x Hunter (2011)	https://www.anime-planet.com/images/anime/covers/thumbs/hunter-x-hunter-2011-4336.jpg?t=1547728696	9	Drawn to the mystique of the unknown, Hunters travel the world in search of terrifying creatures, incredible riches, and unexplored lands. Gon Freecss is a naive-yet-determined young boy who aspires to join the ranks of these individuals, in order to find his missing father Ging - a master of the profession himself. To reach his goal, he partakes in the formidable Hunter Exam, a series of tests that push the participants to their physical and mental limits, with a Hunter License as the prize. During the exam Gon befriends vengeful Kurapika, doctor-to-be Leorio, and skilled assassin Killua, who have entered for their own reasons. But with the sinister Hisoka standing in their way, will Gon and his friends be able to succeed in obtaining their reward, or even escaping with their lives?	2011	2021-07-03 11:49:15.502+02	2021-07-03 11:49:15.502+02
10	your name.	https://www.anime-planet.com/images/anime/covers/thumbs/your-name-7639.jpg?t=1537820529	10	Mitsuha and Taki are two total strangers living completely different lives. But when Mitsuha makes a wish to leave her mountain town and for the bustling city of Tokyo, they become connected in a bizarre way. She dreams she is a boy living in Tokyo while Taki dreams he is a girl from a rural town he’s never been to. What does their newfound connection mean? And how will it bring them together?	2016	2021-07-03 11:49:15.522+02	2021-07-03 11:49:15.522+02
