12	Demon Slayer: Kimetsu no Yaiba	https://www.anime-planet.com/images/anime/covers/thumbs/demon-slayer-kimetsu-no-yaiba-10326.jpg?t=1619536285	12	Bloodthirsty demons lurk in the woods, and nobody dares to venture out at night, save for the demon slayer of legend. Surviving in this harsh world, young Tanjirou takes it upon himself to protect his family–until the day that everything is taken from him in a vicious slaughter. Now, all he has left is his sister, and she’s not even human anymore.	2019	2021-07-03 11:49:15.543+02	2021-07-03 11:49:15.543+02
29	Spirited Away	https://www.anime-planet.com/images/anime/covers/thumbs/spirited-away-93.jpg?t=1429317401	29	Chihiro and her family are on their way to their new home, when they discover an abandoned amusement park. After Chihiro's family mysteriously turn into pigs, she is thrown into a surreal world of magic and fantasy. Join her as she struggles to survive in the bathhouse of the gods, ruled by an evil witch who has stolen not only her name, but her way back to the real world.	2001	2021-07-03 11:49:15.825+02	2021-07-03 11:49:15.825+02
13	Gintama Kanketsu-hen: Yorozuya yo Eien Nare	https://www.anime-planet.com/images/anime/covers/thumbs/gintama-kanketsu-hen-yorozuya-yo-eien-nare-5219.jpg?t=1534042094	13	While watching a movie, Gintoki comes upon a "movie thief," a figure in Japanese culture often depicted as a man with a video camera as a head. After scolding the movie thief for his actions, he finds himself warped into another world via the camera lens. In this world, 5 years have passed, and not only has the land of Edo changed into an apocalyptic wasteland, but Kagura has changed into a beautiful woman with no Chinese speech pattern, Shinpachi has turned into a cool samurai who is not a tsukkomi anymore, and the Gintoki of this time has gone missing, though he is assumed to be dead. Gintoki is determined to find out the truth of the deadly sickness that is ravaging Edo, and also to understand the feelings of Kagura and Shinpachi, who have been trying to deal with their leader's disappearance.	2013	2021-07-03 11:49:15.57+02	2021-07-03 11:49:15.57+02
14	Code Geass: Lelouch of the Rebellion R2	https://www.anime-planet.com/images/anime/covers/thumbs/code-geass-lelouch-of-the-rebellion-r2-1865.jpg?t=1475637995	14	Area 11 is still under Britannian rule and the Elevens remain brutally oppressed; what’s more, their saviour, Zero, is nowhere to be found and all of Britannia believes the rebellion is finally over. Elsewhere, having lost the battle, Lelouch sets his sights upon winning the war – but the task is no easier since the Britannian forces have learned some valuable lessons all of their own. Not only have they discovered his identity and captured many of his Black Knights, but they now manipulate the memories of all of his friends. Worst of all, they have taken the most precious thing in his life – his dear sister, Nunnally. With his hatred for the Britannians stronger than ever before, Lelouch must now recuperate his forces and bring their rule of terror to an end.	2008	2021-07-03 11:49:15.587+02	2021-07-03 11:49:15.587+02
